INSERT INTO `zkb_xgyz_log` VALUES ('292432', '7839467', '物业把小区空地和过道作为停车位出售是否违规？', '该小区是老旧小区，小区内没有划停车位，前天晚上我把车停在了那辆银色大众后面，晚上12点过车主打电话叫我挪一下，说不然把车砸了。我下去便叫他砸给我看，随后他说那个车位他们给了钱的，叫我开走什么的，那人老婆说他酒喝多了我也没计较，由于第二天结婚要早起，我看前面还有车位我就直接开走了。    个人认为这些“车位”物业不能私自出租给业主吧？即便是出租，由于住户多车位极其少，小区上百户住户也应该抽签来获得租用权吧？  如果违规，该向什么部门投诉。   【图片】', 'http://www.zuanke8.com/thread-7839467-1-1.html', '七年之后', '111220ulbsbm7bbm7mo4bl.jpg,111227blc7i5a1e172173e.jpg', '2021-02-01 11:20:00', '0', '1', 0, NULL, NULL, NULL, NULL, NULL);
