INSERT INTO `zkb_xgyz_log` VALUES ('292589', '7839675', '有物业上班的吧友吗，你们小区的物业好吗', '刚看有吧友问车位的事，突然意识到自己在物业待了快两年了，里面的辛酸苦辣太多了，打你你还要给他叫爸爸那种。吧友有关于物业的问题可以留言哦～\n\n给大家说几个管物业的部门\n\n住建局的物管办，特检所，消防大队\n\n物价局，市场监督局，人防办，城管，社区，街道，\n\n例如电梯的年检很多老小区都过期了，可以拍照留证，和物业商量减免物业费，不然举报一下，很多物业半年白干了，特检所管。\n\n第二个很多老小区消防管没水，大家可以去消防水试一下，拍视频留证，消防大队管\n\n第三个，找到物业合同，根据合同保留服务不到位证据，物管办举报，要求减免物业费', 'http://www.zuanke8.com/thread-7839675-1-1.html', 'aa191567283', NULL, '2021-02-01 12:24:00', '0', '18', 0, NULL, NULL, NULL, NULL, NULL);
