INSERT INTO `zkb_xgyz_log` VALUES ('292612', '7839718', '茅台抢购前方发来最新报道', '有消息称，2月1日起，针对1499平价53度飞天茅台，所有线上线下茅台零售商不得设置消费限制门槛或“仅会员购买”。\n\n此前各类平台上都有设置各种门槛，需要你加入会员或有购物记录才能参与到抢购茅台的活动之中，很多消费者都怨声载道。如今公布新规，却有抢茅人士表示，不设门槛感觉更难抢了。\n\n目前京东商城、厦门夏商都相继修改了规则。其中，厦门夏商将原本的前三个月消费3000分、6000分分别可预约购买2瓶、4瓶修改为前三个月消费次数达4次；原本的预约抢购改为抽签；原本一个月限购4瓶改为全年限购2瓶。\n\n但物美、华润万家等目前没有修改规则。', 'http://www.zuanke8.com/thread-7839718-1-1.html', '沃德基尔邦硬', NULL, '2021-02-01 12:36:00', '0', '5', 0, NULL, NULL, NULL, NULL, NULL);
