INSERT INTO `zkb_xgyz_log` VALUES ('292678', '7839823', '最近我给一对男女做了次媒人，简单地说下经过。', '男孩纸：82年，独生子女，工作稳定。他是认识的人托付给我的，我没见过这个男孩纸。前几天，碰到一70多岁的长者，聊天时得知他女儿87年还没嫁，也是工作稳定。我就随即说，我知道一个男孩纸，也是单位上班，工作稳定的。老者说：好，叫我帮我去问下年纪和其它的基本情况。我说能不能直接把您女孩微信告诉我，我告诉男方，让他们直接去沟通啊。我们就不插手老者说：我女儿要先看一下男方的情况，再做决定谈谈。\n\n于是，我第二天就把男方82年，独生子女，父母都退体了，房子前几年就买了。条件相当不错。告诉给女孩的父亲，也就是老者。\n\n结果，老者当场就说，这个男的怎么年纪这么大啊？我说，男大女5岁很好，很正常啊。老者就说，好，我把他的情况告诉我女儿。\n\n第三天，我碰到老者：老者说，我女儿说，这几天身体不舒服，和这个男孩谈不了了。我立马回复：那我就回复男孩那边，您女儿这边不想谈，可以吧？老者说：行，可以这样说的。\n\n于是，我晚上就打电话和男方如实说了女方不想和他谈的情况了。 并且劝了他，我说，连面都不给见，难怪年纪拖到这么大，剩女是有原因的。我说接着，男人三四十是黄金时期，莫灰心，只要有见面的机会，肯定会碰到合适的，你这条件是相当不错。这个女方错过你，是她的损失。\n\n\nPS：写在结尾，我人生第一次做媒就失败了，主要是我连让男孩和女孩面都没见成，天都没聊成就PASS了。真是感觉遗憾。\n\n\n大家说下，我做媒失败的原因在哪里？？下次我好注意，避免失败。\n\n\n你们呢？有帮别人做过媒或牵过线的经历么？？ 来说说。', 'http://www.zuanke8.com/thread-7839823-1-1.html', '瘦弱男生有力量', NULL, '2021-02-01 13:15:00', '0', '38', 0, NULL, NULL, NULL, NULL, NULL);
