INSERT INTO `zkb_xgyz_log` VALUES ('292730', '7839912', '最近很焦虑，看到很多发财的小老哥', '1.同村比我大10岁的小老哥A，来深圳早，本来初中还没毕业的他在工厂做司机，之后转做工厂的业务，后来又搞红酒生意。目前深圳有房有车了。\n2.同村比我大4-5岁的小老哥B，在珠海做旅游和饮食生意，同样小学毕业就出去工作，目前也是开了两间餐厅，回来过年说话都是带着爆发户的气息。\n3.同村的小兄弟我，本科毕业，目前在0755还是业务一名，还没有车也没有房，每天早8晚5工作，累苦，今年希望能加油买部车子吧。还需要努力和找到门路。', 'http://www.zuanke8.com/thread-7839912-1-1.html', '时间永横', NULL, '2021-02-01 13:57:00', '0', '0', 0, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `zkb_xgyz_log` VALUES ('292731', '7839914', '家里装修完，要买灯具了，求老哥指点', '家里灯还没有买，有懂的老哥指点一下\n\n1.准备家里整体米家系列，用小爱控制。\n2.卧室已经在床头改了双控，可能卧室使用性价比高的传统灯就行。\n3.客厅餐厅没装双控，需要语音控制的智能灯\n4.装修的时候还加了吊顶灯带，这玩意能米家智能控制开关吗？\n\n\n老哥们给推荐一下性价比比较高的小爱系列的智能灯，还有就是传统灯具怎么选？有什么牌子推荐吗？', 'http://www.zuanke8.com/thread-7839914-1-1.html', 'mf675951283', NULL, '2021-02-01 13:58:00', '0', '35', 0, NULL, NULL, NULL, NULL, NULL);
