INSERT INTO `zkb_xgyz_log` VALUES ('292753', '7839949', '[京东监控] 求助.', '最近东哥老是偷偷放货, 于是想做个京东放货监控, 毕竟自己不是专业的, 目前有几个难点需要求助, 恳请知道的吧友指点一二. 在此承诺, 做成之后免费给吧友无限期使用!\n1. 目前市面很多可安装应用需要自己安装到电脑上进行监控,但是需24小时开机运行 并且毕竟是别人写的软件,自己账号有被盗或者电脑被入侵风险. 设置不当更可能将自己的ip弄黑. 所以我想做成云服务器进行监控, 微信群进行提醒的方式(干净链接).只需加群并设置免打扰, 有监控到放货的时候进行 艾特所有人.(目前微信自动提醒这块已经攻下.)\n2.对于东哥家的库存参数逻辑有点理不清. skuState为1为上架,StockState 33 36 39 40都代表可下单. 但有时候别的状态也可以下单,这点还没搞懂.希望吧友指教.\n\"100012043978\":{\"StockState\":33,\"ab\":\"-1\",\"ac\":\"-1\",\"ad\":\"-1\",\"ae\":\"-1\",\"skuState\":1,\"PopType\":0,\"af\":\"-1\",\"ag\":\"-1\",\"sidDely\":\"331\",\"channel\":1,\"StockStateName\":\"现货\",\"m\":\"0\",\"sid\":\"331\",\"rfg\":0,\"dcId\":\"6\",\"ArrivalDate\":\"\",\"v\":\"0\",\"IsPurchase\":false,\"rn\":-1,\"eb\":\"0\",\"ec\":\"-1\"}\n复制代码\n3. 有些商品一直处于下架状态,导致普通搜索商品根本搜索不到,但是有的监控却能在第一放货时间进行提醒,肯定是有方法能拿到这些下架商品的商品id的,目前我还不清楚怎么找(类似于之前偷放的飞天2019,一旦下架 除非吧友发链接,不然根本找不到这个商品).\n\n再次承诺, 做成之后免费给吧友无限期使用!', 'http://www.zuanke8.com/thread-7839949-1-1.html', '漂流瓶3', NULL, '2021-02-01 14:13:00', '0', '49', 0, NULL, NULL, NULL, NULL, NULL);
