INSERT INTO `zkb_xgyz_log` VALUES ('292870', '7840125', '关于昨天发的联通手机营业厅每天领3G流量的一个整合', '昨天那个帖子的网址原作者已经删掉了\n在下面写个自己的一点心得\n第一步先下载科学上网：https://wwa.lanzous.com/iKDnFl5ogxe\n\n然后下载需要的软件\n\n链接：https://pan.baidu.com/s/1Kbfk-9Nq6vsHKGEIE13vOQ\n提取码：063l\n这个就是类似超级终端的东西我也不知干什么\n\n下载好这两个软件以后先打开科学那个，然后启动，然后再打开类似超级终端的东西，等待启动完成后\n输入以下命令，每行一个没输入一行就按回车一次。\n\npkg update -y\n\n\npkg install git vim perl nodejs-lts wget curl nano cronie moreutils -y\n\ngit clone https://github.com/lunnlew/AutoSignMachine.git\n\nls\n\ncd AutoSignMachine\n\nls\n\nvim package-lock.json\n\n\n\n这里进去我们找到第三行把里面的2改成1，\n这里你们直接点肯定改不了，\n点下2后面的那个点会有光标，然后按下【i】键就可以删除了\n删除后我们再点下键盘ESC键，最后直接输入【:wq】看清楚括号里\n输入完就回车键\n\n继续代码\n\nnpm install\n\nnode index.js unicom --user 131*******12 --password 11****11 --appid f7af****ebb 这个要全部复制\n\n\n\nuser：是手机号 password:服务密码\n\nappid:文件夹Unicom里面，直接搜索就可以看到了（关于APPID有的人说找不到，先安装官方的联通营业厅APP然后登陆你自己的手机号，然后在手机自带的文件管理器里找手机自带的内存然后找到Unicom文件夹，然后里面就看到有个APPID的文件直接用文本形式打开全部复制出来把上面的f7af****ebb 替换就行了。\n\n\n关于把软件重新关了再重新运行时怎么办我的解决办法就是用下面四条命令。\n\nls\n\ncd AutoSignMachine\n\nls\n\n\n\nnode index.js unicom --user 131*******12 --password 11****11 --appid f7af****ebb\n\n\n剩下的我也不懂别问我这里的大神多，让其他大神给你解答吧我真的不懂。\n\n\n还有最后有一个部署云函数的我不会，发个文件大家看看，想学习的就可以照着这学习下\nhttps://wwa.lanzous.com/ir7aTl4t4oh\n\n差不多就这么多吧，图片就不放了，对了最最后再说下git那个网址里面的文件关于签到的还有好几种\n\n可能命令写对了还能给京东什么的签到吧。\n\n有人问这是不是全国的应该是全国的联通活动。', 'http://www.zuanke8.com/thread-7840125-1-1.html', '448190058', NULL, '2021-02-01 15:24:00', '0', '16', 0, NULL, NULL, NULL, NULL, NULL);
