INSERT INTO `zkb_xgyz_log` VALUES ('292882', '7840141', '支付宝五福攻略！！', '支付宝集福今天正式开始了，活动时间2月1日到2月11日，瓜分红包时间2月11日晚上22:18，以下是无咎我手动整理的最简单最直观的方法，每天都可以多次参加，重复扫！每张福卡还可以抽奖，进入支付宝五福页面，点顶部我的福卡，点右下角刮奖抽不同的奖励！\n\n\n一：AR扫码\n扫福\n\n\n二：写福字\n支付宝搜索“写福字”->点右边写福字进入->领取手写福卡->可以领取两次\n\n\n三：蚂蚁森林和芭芭农场\n支付宝搜索“蚂蚁森林”->进去后找能量->点福气球->抽取福卡->目前尚未开启->2月4日开启！\n\n\n手机淘宝搜索“芭芭农场”->进入后施肥抽取福卡->目前尚未开启->2月7日开启！\n\n\n四：搜索关键字\n支付宝首页顶部搜索这些关机键字->就可以看见抽福卡入口：一汽大众、银泰百货、肯德基、麦当劳、星巴克、滴滴、蒙牛、爱琴海、星河、大悦城、砂之船奥莱\n\n\n五：扫专属图片\n打开支付宝->扫一扫->选择AR->然后打开链接：https://禁止使用跟踪跳转地址/mnBtDE 对着每张图片放大（貌似第二张图片很大概率会中沾沾福卡）->扫码抽取福卡->需要有两台设备的才可以\n\n\n六：消费券抽沾沾卡\n支付宝搜索“消费券”->点进去后->翻卡片->几率得沾沾福卡\n\n\n七：找剪纸任务\n打开地址：https://禁止使用跟踪跳转地址/8McDJn 支付宝扫码进入活动->每个任务依次按照提示操作->都做完后即可抽取->万能福或沾沾福\n\n\n八：福气盲盒\n打开下面链接->需要验证手机号->领取随机福卡->领取后需要激活->到支付宝卡包->去使用->手动领取即可！\n\n\n1、天猫精灵\n\n\n<a>https://render.alipay.com/p/c/17yq18lq3slc?source=JING_LING</a>\n\n\n2、飞猪\n\n\n<a>https://render.alipay.com/p/c/17yq18lq3slc?source=FEI_ZHU</a>\n\n\n3、优酷\n\n\n<a>https://render.alipay.com/p/c/17yq18lq3slc?source=YOUKU_TV</a>\n\n\n4、淘票票\n\n\n<a>https://render.alipay.com/p/c/17yq18lq3slc?source=PIAO_PIAO</a>', 'http://www.zuanke8.com/thread-7840141-1-1.html', 'cango', NULL, '2021-02-01 15:28:00', '0', '6', 0, NULL, NULL, NULL, NULL, NULL);
