INSERT INTO `zkb_xgyz_log` VALUES ('294037', '7841911', '辛辛苦苦搞了好久，就赚了一百来块，pdd是真的玩不起', '百亿会员有个对赌完成4单的88折券，每天可以一张，然后switch游戏卡算是一个价格比较硬的通货\n4天买了皮克敏3赚15，马里奥赛车赚30，马里奥奥德赛赚30，路易鬼屋赚25\n今天去领不让买游戏卡了，就是对赌，然后你没完成pdd扣钱，你完成了pdd不让买比较值的东西，玩不起\n本来每天二三十块的毛撸撸还行，找卡看市场价也挺费时费力的\n然后搞黑卡买了库巴之怒的预售，我看了预告挺好玩，赚个小几十应该没问题\n最后给老婆买了个有氧拳击和舞力全开，平进平出就满意了', 'http://www.zuanke8.com/thread-7841911-1-1.html', 'mqb1993', NULL, '2021-02-02 10:41:00', '1', '115', 0, NULL, NULL, NULL, NULL, NULL);
