INSERT INTO `zkb_xgyz_log` VALUES ('294238', '7842224', '中行xing/用卡50买70立减金细则', '中行xing/用卡绑定微信，手机登录此微信，xing/用卡预留手机号能收短信。找大堂经理，跟她说明参与这个中行xing/用卡50买70券的活动，然后大堂经理会指导你操作，我这的营业厅不知道这个活动，没弄过，行长知道，打电话问了步骤，和大堂经理一起跟我操作，先是手机收一个验证码，然后客户经理手机出一个10秒的码，拿绑定中行xing/用卡的微信扫，然后会出现一个选择页面，我当时出了50买70立减金和50买70京东e卡两个优惠，我选的立减金，然后进去有售价，70，点击支付，会发一个预留手机号的验证码，验证后，跳转微信支付，然后选择中行xing/用卡，支付直接是50，支付成功微信就到帐7张微信立减金，无门槛，满10可用，每次一张，有效期60天。【图片】', 'http://www.zuanke8.com/thread-7842224-1-1.html', 'wdzgxmq', 'http://img.zuanke8.com/forum/202102/02/123502af1hwlqa1oso5jai.jpg,http://img.zuanke8.com/forum/202102/02/123503ast5gfhbo4owp7b2.jpg,http://img.zuanke8.com/forum/202102/02/123503tmyygieify8tmfsn.jpg', '2021-02-02 12:37:00', '0', '90', 0, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `zkb_xgyz_log` VALUES ('294239', '7842227', '好医保，历时一个月赔付通过了', '2020.2月吧里都在买，跟风买了，当时用了100多红包花了106买了首年，7月份查出甲状腺结节，2021.12复查确诊甲状腺肿瘤，手术双切。花了4.5W，医保报销完花了1.5W多。12.29申请好医保理赔，今天赔付到账2.5W（1.5W自己花的 1W重疾险补贴），中间进度很慢，理赔员现场审核', 'http://www.zuanke8.com/thread-7842227-1-1.html', 'aigo501', NULL, '2021-02-02 12:38:00', '0', '31', 0, NULL, NULL, NULL, NULL, NULL);
