INSERT INTO `zkb_xgyz_log` VALUES ('294327', '7842357', '我来说说jd娃哈哈哈tb娃哈哈，为吧友解解惑。', '本吧也算是老吧友了去吧5年多了，偶尔跟着吧里撸点小优惠，大毛是绝缘体。\n之前也一直在吧里看到吧里说娃哈哈，但是直接没进一步，有很多原因，主要还是舍不得开plus,这些年都是苦过来的，特别对不起老婆和家人。\n好了！言归正传，正式接触娃哈哈是去年12月份，得知老婆花重金开了京东plus开启了娃哈哈之路，开始并不抱希望，因为老婆京东号信用并不好88.3分，金条白条全部tao完，多次逾期，记得应该是抢了10天左右抢到了第一瓶，超级兴奋的跟老婆说我把你开plus的钱赚回来了，老泪纵横啊，接着12月底又梅开二度。\n说说淘宝，看了上面应该知道我们是债务缠身了，淘宝也不例外，借呗花~贝一样，多次逾期。天猫娃哈哈是在京东第二瓶后才知道可以抢购的不用开会员看，吧里帖子找的方法。今年一月开始，淘宝更加不抱希望，老婆淘宝购物10件有8件都是要退货的，芝麻分624分不高不低，但生活总是会有意外的惊喜，天猫不到5次就毕业了。\n希望对吧友有用！【图片】', 'http://www.zuanke8.com/thread-7842357-1-1.html', 'p88047937', '135033tqsdjfsfjfdzif9q.jpg,135042iwp4i3v45rt1r154.jpg,135052ys3g9d5e9i9fp1s1.jpg,135110pw5wayhyh63lyemh.jpg,135203k8br7ndx4nj014ow.jpg,135215d7ztm414ykkyjk80.jpg', '2021-02-02 13:52:00', '0', '44', 0, NULL, NULL, NULL, NULL, NULL);
