INSERT INTO `zkb_xgyz_log` VALUES ('294375', '7842422', '京东快递员有点坑人了', '今天换货这件羽绒服<a>http://www.zuanke8.com/jd.php?search_kw=https%3A%2F%2Fitem.jd.com%2F10021816400739.html</a>   这件衣服页面写了毛重是1kg\n页面写了上面取件8块钱运费，想着上面方便，就选了上门\n\n\n\n然后快递员今天打电话说快递费要12，我说怎么跟页面显示不一样，又问了京东客服，京东客服说是商城bug，快递员说多少就是多少。\n\n然后我就转了12给快递员，结果他把面单发我，我一看计费重量写了2.2kg，我就问她怎么回事，她说忘记去皮了，说她们起步价就11，然后给我发了红包，我也没收就算了。\n\n但是不知道为何早上咨询的京东客服下发了投诉工单，然后京东客服给我打电话说确实应该算8元，说快递员那边说算上泡重了，体积超了。快递员也联系我又说他没输入错，就是衣服体积超了，我说我之前寄3件衣服都没超体积，你这个1件羽绒服给我说超体积了？？\n\n我也一直没要这快递红包，本来想着这次多收就算了，结果又反过来说一个羽绒服体积超了，就想问问吧友真是超体积了吗？', 'http://www.zuanke8.com/thread-7842422-1-1.html', '干就完事', NULL, '2021-02-02 14:23:00', '0', '63', 0, NULL, NULL, NULL, NULL, NULL);
