INSERT INTO `zkb_xgyz_log` VALUES ('294411', '7842475', '富民银行，新用户注册并不会显示定存宝产品，但是。。。', '但是，可以找在线客服聊天，把这款产品给聊出来。。。\n\n客服会问，你是通过什么途径了解到定存宝这款产品的？可以回答：以前在京东金融看到过\n\n客服还会问，你以前购买过我行的定期存款产品吗？可以回答：很久之前在京东买过（即使从没买过，也可以适当嘴硬一下，反正我觉得不能回答从没买过）\n\n客服还会问你已经在app上完成开户了吗？所以尽量先把电子户开好，也就是富民的二类卡账户，再去咨询客服\n\n最后，客服会让你留下姓名、shen/份证号、手机号，然后让你等几天再登录试一下。\n\n\n\nPS：前几天我发帖说，辽阳彻底没了，但蓝海还有，好多老哥回复可以存富民的，于是我实在忍不住就开户了，然后找客服聊天，硬生生把定存宝给聊出来了，然后看完规则我才发现，这是什么鬼啊？\n\n对于经常存辽阳和蓝海的来说，早已习惯定期结息到账这种模式，说白了就是复利，每三个月、半年或者一年，给你付利息，然后利息可以再存，而富民的定存宝明明就是你不取出来，它不给付利息啊！\n\n而且定存宝并没有哪项规则表明，像某些老哥所说的那样可以定期转活期？比如存3个月的是4.5%，3个月后不论什么时候取出，例如8个月的时候取出，全都是按4.5% 并没有，而是不满期的按活期，规则里面说的非常清楚\n\n<a>http://www.zuanke8.com/thread-7832980-1-1.html</a>', 'http://www.zuanke8.com/thread-7842475-1-1.html', 'Chevrolet', NULL, '2021-02-02 14:48:00', '0', '13', 0, NULL, NULL, NULL, NULL, NULL);
