INSERT INTO `zkb_xgyz_log` VALUES ('294520', '7842621', '关于二月份恒大楼盘全国优惠活动', '2月1日起，恒大在全国开展网上购房周年优惠，消费者在“房车宝”缴纳3000元认购房源，即可享受75折+3万元优惠。同时，2月6日还可参与限时秒杀，秒杀到手的房子可在75折基础上享受额外93折优惠。\n\n通过我这边依然是佣金全返，新盘及普通楼盘2%    热销1.5%，只为做任务，双赢，吧里有几个老哥已经享受这个优惠了，佣金也全返了', 'http://www.zuanke8.com/thread-7842621-1-1.html', '吻舞拥抱', NULL, '2021-02-02 15:39:00', '1', '66', 0, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `zkb_xgyz_log` VALUES ('294521', '7842625', '女孩现实热情 网上冷漠是怎么回事？', '同公司的一个女孩 小我三岁 没有男朋友  同事们都说我年纪外貌和她般配  有个同事还老想撮合我和她  我偶尔跑她们部门门店  她都会主动走过来和我打招呼聊天  她也偶尔主动跑来找我聊天  聊天慢慢熟悉还问我家庭情况爱好啥的 有下午茶吃还会叫我过去吃 还有几次大家一起点午饭 明明她一个人能拿的  她都还叫我一起去拿  同事看见了她还会说我两去约会这样暧昧玩笑的话  两个人一起搭电梯时候我问她身高 摸她头  她也是笑笑不抗拒。  但是几次我主动VX找她聊天  例如我路过一起讨论过甜品店 我特意拍照给她看  她好久才回复的  有时聊着聊着就不回了 朋友圈也几乎没有互动。  我都蒙了  这是什么情况', 'http://www.zuanke8.com/thread-7842625-1-1.html', '尤文图斯', NULL, '2021-02-02 15:40:00', '0', '4', 0, NULL, NULL, NULL, NULL, NULL);
