INSERT INTO `zkb_xgyz_log` VALUES ('294523', '7842626', '小米手机晚上睡觉后锁屏收不到微信消息的解决方法', '关于小米手机第二天一打开屏幕微信和各应用推送，有时候后半夜工作群发些东西根本就没有提醒，到第二天早晨一打开手机群里各种刷屏有的人说是因为断流，明明手机流量和wifi都开着了，并且连着了为什么还会这样？微信肯定后台常驻了，省电模式也关着了。wifi设置也是永久不断开的设置，明显就是有设置在你睡觉的时候给你省电关了。\n\n打开设置-省电与电池-右上角设置-场景配置-睡眠模式关了\n\n说一大堆废话就中间这一段有用\n\n需要自己搞一下，要不长时间锁屏不操作网络就会自动断开\n\n觉得有用给我加个果啊。', 'http://www.zuanke8.com/thread-7842626-1-1.html', '448190058', NULL, '2021-02-02 15:40:00', '0', '35', 0, NULL, NULL, NULL, NULL, NULL);
