INSERT INTO `zkb_xgyz_log` VALUES ('294633', '7842782', '最近遇到家人疑难杂症，医院也束手无策，难道真的要进京？', '县医院治了几天，感觉好转的太慢，转院市医院，市医院也是束手无策说不上个所以然，查什么都没有问题，钱花不少，就是说不出是什么病，难道真的要去北京才能治疗这种疑难杂症吗？？\n\n症状就  头晕，呕吐，闭眼会缓解，只要动就头晕的厉害，有时候会头胀，脑部，胸部CT 核磁共振 彩超都查过了，都没有问题\n原来眩晕门诊，耳鼻喉门诊，医生都猜测是 耳朵类疾病，做了 前庭功能检查，一切正常\n转到神经内科医生看了之后，也不知道是什么病，会诊让CT室医生会诊后，也是给的结果是正常\n医生现在猜测是 毛细血管可能有堵塞，但是市医院也没有这种仪器，难道非要去北京？', 'http://www.zuanke8.com/thread-7842782-1-1.html', '花小兰741', NULL, '2021-02-02 16:47:00', '0', '4', 0, NULL, NULL, NULL, NULL, NULL);
