INSERT INTO `zkb_xgyz_log` VALUES ('294663', '7842820', '约了三次，终于给弟弟的相亲对象约出来了', '年底各种结婚，各种相亲\n作为过来人，曾经有很多人帮助\n所以，相应的提身边的单身汉操操心\n\n堂弟普通工作，为人还算老实\n感情经历一波三折\n由于年龄很小\n所以一只都是不为人知的恋爱\n钱花了不说，最终还是散伙\n\n家里人觉得这样不行\n虽然年纪小，但是长此以往\n名声坏了，就不好再说对象了\n刚好20岁的年纪，也到了相亲的年纪了\n就拖我们给介绍一下\n作为一个老货\n我这也不认识这么年轻的女孩呀\n并且这种关系，女孩人品还是要把关的\n\n突然想起来，当初上学的时候\n在轮滑社，认识一个在学校上五年制的女孩\n其实年纪才15岁左右\n然后总找我玩，感觉和小孩子没啥意思\n就不怎么联系\n翻了翻朋友圈，居然早早辍学来上海上班了\n算了算年纪也差不多\n就约了几次，介绍了情况\n好不容易才答应本周末来我家玩\n\n打算是吃烤肉，然后喝点小酒\n突然想起来烤肉锅还没买\n各位友友们，有没有推荐呀\n事关重大，吃美了，喝美了，说不定就成了', 'http://www.zuanke8.com/thread-7842820-1-1.html', '2868285528', NULL, '2021-02-02 17:09:00', '0', '103', 0, NULL, NULL, NULL, NULL, NULL);
