INSERT INTO `zkb_xgyz_log` VALUES ('294689', '7842859', '人在车上被拍了违停', '路边没有禁停标志，人也在车上，警察过来直接拍完照就跑。。。。。。。\n\n过两天短信告诉我违反禁止标线指示罚200扣3分。。。。\n\n看照片也没看懂到底违反了哪条标线指示。。。。\n\n我也明白他们现在不按照违停处罚，因为违停的话车上有人并立即驶离的不用处罚，而且违停是罚100不扣分\n现在他们搞了这么一个违反禁止标线就可以偷偷拍了就跑，也不用现场开处罚通知单了', 'http://www.zuanke8.com/thread-7842859-1-1.html', '忘了叫啥', NULL, '2021-02-02 17:29:00', '0', '29', 0, NULL, NULL, NULL, NULL, NULL);
