INSERT INTO `zkb_xgyz_log` VALUES ('296037', '7844816', '求助！微信小程序不需要密码自动扣钱，怎么办', '孩子用我的手机微信小程序玩永夜之役，不需要支付密码直接扣除了微信零钱通。\n游戏诱导儿童消费，熊孩子估计都不知道会被扣钱。\n\n但手机设置了支付密码，在孩子不知道密码的情况下微信零钱通直接被扣款，微信小程序居然能跳过支付密码随意消费，安全性也太差了。\n\n我点进游戏看了一下，不需要支付密码，甚至不需要验证码，可以直接扣微信零钱。这个游戏还假惺惺在支付的右上角设置了一个使用密码的选项。\n也就是说要专门选择使用密码才需要输入密码支付，也是醉了！\n\n\n这次还好及时发现，钱不多！求助万能的吧友，该怎么设置才能避免再出现这种情况.\n我的免密支付这些都是关掉的，扣费服务也只开了一个公交，其它的都没有。\n\n这也太可怕了，大家手机一定要随身携带啊，真是防不胜防！！！！【图片】', 'http://www.zuanke8.com/thread-7844816-1-1.html', '财神侠', 'http://img.zuanke8.com/forum/202102/03/122213it6w3fveye83s1qs.jpg', '2021-02-03 12:25:00', '0', '19', 0, NULL, NULL, NULL, NULL, NULL);
