INSERT INTO `zkb_xgyz_log` VALUES ('296136', '7844955', '劝大家还是不要养狗。', '狗这种东西，一旦养上了，就是一种累赘，注定着有一天要难过。\n家里的小黑是一只京趴，今年已经估计15岁了。\n从小学陪伴我到结婚，我们吃剩下的给她吃，感觉习惯在身边蹦蹦跳跳，拉撒在家里的时候还要打扫。因为她，我们家还没法长期出远门，爸妈说恨透了，不说只是嘴上说说，对她还是超级好。\n近年来身体每况愈下，跳不动，走不动，没精打采的，就是睡，身上还长了好几块大肿瘤。\n问医，医生说，这么年龄的狗，手术摘除的意义不大。\n可是越来越大，感觉都有半个身子大了，这两天给她好吃好喝的也不吃了，奄奄一息，感觉快不行了，不知道能不能熬到明年。\n快要说再见了，一家人都很难过，毕竟15年了，从小到老，吃我们家饭一起过来的，鉴证了我们的开心和难过，陪伴着我们从贫穷到小康，是我们家的一份子。\n\n以后再也不养这些玩意儿了，终究是有这么一天的，费感情。', 'http://www.zuanke8.com/thread-7844955-1-1.html', '宝贝じ☆爱你', NULL, '2021-02-03 13:20:00', '0', '50', 0, NULL, NULL, NULL, NULL, NULL);
