INSERT INTO `zkb_xgyz_log` VALUES ('296158', '7844972', '上海银行590元话费！（活动比较麻烦，没耐心的就别看了~）', '1.拥有上海银行手机银行账户；\n\n2.到上海银行柜台完成理财风险评估；\n\n3.下载上海银行APP；\n\n4.进入上海银行APP后，如果界面跟我显示的不同，可以点击“我的”，然后下拉，选择“精诚至上”风格；\n\n5.在首页中的活动横幅中找到“财富嘉年华之玩转手机达人”活动，如果没有可以点击“投资”找到该活动；\n\n6.点击进入任务后会进入如下活动界面，可以看一下活动的规则，可以看到只要完成“资产配置任务”，就能够快速的获得兑换话费所需要的“财星”，不需要每天做任务积攒，因此这个活动的核心就是完成“资产配置任务”上的三个任务；可以看到我的界面三个任务都是已完成，如果没有完成的话会显示“去完成”，点击界面会自动跳转到完成任务的界面，这里需要注意，如果前面没有去柜台开通理财风险评估，这三个任务都是无法完成的；\n\n7.首先来说第一个“理财”任务，点击之后就会跳转到上海银行的理财专区，上海银行的理财一般是一万起购，如果喜欢活期储蓄，可以选择“活期＋”中的“福利派A”，如果有闲钱可以选择“周期开放”中的“周开鑫”、“惠享周期”（如果是工资卡客户，可以选择代发工资的项目，利率会高那么一点点）等，投资完成即可，一般等3~5天就会确认份额；\n\n8.然后是第二个“基金”任务，点击之后就会跳转到上海银行的基金专区，随意挑选一元起购的基金即可，不放心可以多买几个，因为有些基金确认份额较慢，购买后等待份额确认即可，时间5~7天；\n\n9.最后是第三个“保险”任务，点击之后就会跳转到上海银行的保险专区，这边会看到保险一般都比较贵，所以我们点击“财富保障”，找到“天利年金保险万能型”，这个只要10元即可，购买的时候会填一部分信息，买完之后保险公司可能会给你打电话确认，确认完成后，等待任务完成即可，时间5~7天；\n\n10.以上三个任务每完成一个，即可相对应的兑换“10元”、“80元”、“500元”话费，每个话费智能兑换一次，特别注意“161”、“170”、“171”开头手机号无法充值；其中“10元”、“80元”话费数量较多比较容易抢到，“500元”话费每天7份，需要每天凌晨兑换，因为库存不是刚好0点的时候补充，会有延迟，所以为了能够抢到“500”元话费，需要另外找个手机或者pad，输入“时间”，在每天“00:00 10”也就是凌晨0点0分10秒左右点击“兑换礼品”，快速点击500元话费的兑换，输入手机号码，并点击确认。我断断续续大概抢了半个月左右抢到了，祝大家能够成功。【图片】', 'http://www.zuanke8.com/thread-7844972-1-1.html', '薛大壮', 'http://img.zuanke8.com/forum/202102/03/133441yvv2db3vvbvcbv26.jpg,http://img.zuanke8.com/forum/202102/03/133441lhiipezq9iihvi8s.jpg,http://img.zuanke8.com/forum/202102/03/134030p17n1rnroz77w8yl.jpg', '2021-02-03 13:41:00', '0', '3', 0, NULL, NULL, NULL, NULL, NULL);
