INSERT INTO `zkb_xgyz_log` VALUES ('296217', '7845089', '大佬们请教个问题，cpu利用率80-90%时蓝屏什么原因？', '电脑型号X64 兼容 台式电脑 (扫描时间：2021年01月24日)\n操作系统Windows 10 专业版 精简版 64位 ( DirectX 12 )\n\n处理器AMD Ryzen 9 3900X 12-Core\n主板华硕 PRIME X570-P ( AMD PCI 标准主机 CPU 桥 )\n内存64 GB ( Asgard DDR4 2666MHz )\n主硬盘三星 SSD 850 EVO 250GB ( 250 GB / 固态硬盘 )\n主显卡AMD Radeon RX 580 ( 8 GB / 蓝宝石 )\n显示器冠捷 AOC2379 2379H ( 23 英寸 )\n声卡瑞昱 <a>http://www.zuanke8.com/space-uid-111639.html</a> AMD High Definition Audio 控制器\n网卡瑞昱 RTL8168/8111/8112 Gigabit Ethernet Controller / 华硕\n\n\n这两天升级了一下电脑，平时用着没有任何问题，今天试了下多开安卓模拟器，CPU占用率到80-90%时，鲁大师监测硬件温度都不高，但是会突然蓝屏，试了很多次都一样，对了，电源是新买的长城巨龙1250W的，按理说CPU占用没满的情况下，应该不会蓝屏吧，这会是哪里出问题了呢？请大佬们帮忙分析下，谢谢！', 'http://www.zuanke8.com/thread-7845089-1-1.html', '实在撸不动了', NULL, '2021-02-03 14:31:00', '0', '2', 0, NULL, NULL, NULL, NULL, NULL);
