INSERT INTO `zkb_xgyz_log` VALUES ('296220', '7845097', '支付宝18.18活动', '活动只有部分人有大额转入的入口，经常买基金或大额充值的才会有\n\n大家可以去先看看自己有没有通道，有的话转入5万即可得18.8元通用红包\n\n大额到账后 红包自动到卡包，可tx，可消费，获得的是余额红包，余额支付就行，没有开花~贝也可以领\n\n注意：需要支付宝已绑定的银行卡转账到大额账户才有红包哦，不能使用快捷充值！【到账即提现】入口：支付宝App--余额宝--转入--点下方大额转入', 'http://www.zuanke8.com/thread-7845097-1-1.html', '玖仰', NULL, '2021-02-03 14:33:00', '0', '2', 0, NULL, NULL, NULL, NULL, NULL);
