INSERT INTO `zkb_xgyz_log` VALUES ('296324', '7845244', '关于微博电影票，我也发表一下自己的观点，其实就是质保时间的问题', '就事论事吧，就是吧里已经说烂了的：\n首先，1.收货佬知道这是微博活动撸的码子，那么就肯定需要承担一定的风险\n2.收货佬没有在帖子里注明需要质保的时间。既然是绑定立返，那就可以认为是买定离手，不需要质保\n3.根据以上两点，交易完成以后，卖家是删了收货佬，还是不回收货佬，都是没有一点问题的。我承认这么做是不符合中华民则传统美德，虽然可能要受到道德谴责，但是道德从来都是用来律己的，而不是用来约束别人的。\n\n\n以上几点，如果我有说的不对的地方，可以指出来，不过要用理论事实，就事论事，而非杠我。看到经常有人拿代刷、e卡什么的来说事，咱们还是就事论事吧，不扯那些。\n\n\n不过在微博能补票的情况下，我认为大家还是有义务去申请补票，然后发给收货佬的，我认为这是应该做的。', 'http://www.zuanke8.com/thread-7845244-1-1.html', '海洋丶', NULL, '2021-02-03 15:40:00', '2', '84', 0, NULL, NULL, NULL, NULL, NULL);
