INSERT INTO `zkb_xgyz_log` VALUES ('296378', '7845331', '大地震！那些在线下载看视频的网站且看且珍惜吧！', '人人影视被抓了！\n\n注册用户超过800万，发布各类影视作品超过2万部的“人人影视字幕组”，近日因侵犯影视作品著作权被上海警方查了\n\n据上海市公安局新闻发言人办公室陆敏韡警官上午透露，上海警方历经3个月缜密侦查，在山东、湖北、广西等地警方的大力配合下，成功侦破了这起国家版权局、全国“扫黄打非”办公室、公安部、最高检四部委联合督办的“9.8”特大跨省侵犯影视作品著作权案\n\n1月6日，上海警方历经三个月缜密侦查，在山东、湖北、广西等地警方的大力配合下，成功侦破“9.8”特大跨省侵犯影视作品著作权案，抓获以梁某为首的犯罪嫌疑人14名，查处涉案公司3家，查获作案用手机20部和电脑主机、服务器12台，涉案金额1600余万元。', 'http://www.zuanke8.com/thread-7845331-1-1.html', '-。-BONG', NULL, '2021-02-03 16:20:00', '0', '22', 0, NULL, NULL, NULL, NULL, NULL);
