INSERT INTO `zkb_xgyz_log` VALUES ('296382', '7845338', '总结科目二第一次失败的原因和第二次成功的经验', '第一次还是开的太快了，出错了也来不及控制。失败后由考场人员开回原点立即开始第二轮，压力非常大，连最熟悉的倒车入库都压到线。\n考场那里的车跟驾校的不一样，考场的车方向盘、离合、刹车都比驾校的更重，驾校那辆车练得人多了方向盘、离合、刹车都比较松动，第一次失败后找教练跟别的教练换了一辆新车练习，总结不同车的区别，今天第二次去考总算过了。\n有人说过“开的越慢，拿证越快”，第二次考跟第一次考是同一辆车，竟然有这种好事。我这次开的比走路更慢，一切都很顺利。考场的车连雨刮器都跟驾校的不一样，我坡道起步为了不压线被扣100分，间隔距离大了一点扣了10分，一共90分通过。', 'http://www.zuanke8.com/thread-7845338-1-1.html', 'x63232128x', NULL, '2021-02-03 16:21:00', '0', '33', 0, NULL, NULL, NULL, NULL, NULL);
