INSERT INTO `zkb_xgyz_log` VALUES ('297117', '7846462', '关于京喜购物后卡任务次数', '之前吧里有个老哥的帖子看不太明白，需要自己摸索。这里我分享一下自己的经验，仅供参考。大家可以给原贴子荚果，我找不到了……\n1. 任务列表里有这个可以多次完成的才行，没有的话等第二天。\n\n\n\n2. 把任务做几次，比如剩3次机会。点看一看，返回成了领取红包。\n3.关键步骤来了，不要点领取红包。在浏览器打开https://st.jingxi.com/pingou/activity/task_rebate/index.html?这个网址4次（比剩的次数多一次，建议多打开几个，比如6个7个都没关系），所有的页面都是领取红包状态，挨着领取，所有的领完之后，就卡成功啦。\n\n\n\n4.后面100多次大家可以用按键精灵录个脚本，手动的话也挺快。【图片】', 'http://www.zuanke8.com/thread-7846462-1-1.html', 'fzh1174182360', '083158keigie3886glner4.jpg,083500tlzejzzg54c15333.jpg', '2021-02-04 08:35:00', '1', '69', 0, NULL, NULL, NULL, NULL, NULL);
