INSERT INTO `zkb_xgyz_log` VALUES ('297247', '7846616', '全网独家吧友专享，京喜返红包任务一天完成无需等待，从0讲解', '之前发了京喜做任务返红包技巧，好多人说看不懂，私信太多一一讲解精力有限，所以决定发一个从0讲的攻略，再看不懂请通知我删帖。\n\n请注意，此攻略建立在已使用免邀请成立订单并处于红包任务待返的情况。\n\n1.在PC端打开网址：<a>https://wqs.jd.com/pingou/activity/task_rebate/index.html</a>，登录你的账号，这里有你的任务信息。其实是有规律的，比如今天一共20个任务，其中最上面9个是浏览10秒任务，最后一个为重复任务。特点就是前面9个为9个条目，最后一个是完成浏览完成11次共用一个按钮。\n\n\n2.卡任务次数：先手动完成浏览10秒的任务，然后把最后的重复任务点开返回一次，这时候页面显示的是领取奖励，不要点。再复制当前网页，打开多个标签页，你会发现所有页面都是领取奖励，然后挨个领取，重复到只剩一次的时候，再进行上面的操作。保证界面为，多标签打开，且按钮字样全部为领取奖励，任务完成次数为一次。挨个领取奖励，这时候因为次数只剩一次，但是你强行领取了奖励，所以任务次数会变成一次性全部跳出来。\n\n3.快速完成：任务次数突破之后，只留一个标签页就行，建议使用chrome浏览器，按F12。点一次任务返回，这时候会弹出奖励信息倒计时小窗口，用指针点击找到相关元素，删除，目的是阻止弹窗。接下来点击“看一看”的同时快速按“ESC”按钮，“看一看”按钮自行变为“领取奖励”。录制一个按键精灵，基本3秒一次的速度完成任务，纵使500个任务也不过是一泡尿的功夫。\n\n\n\n感觉已经写的很详细了，再看不懂，我只能录视频了...\n\n好用的，麻烦加个果，我也想成为赚神的男人。【图片】', 'http://www.zuanke8.com/thread-7846616-1-1.html', 'luominluan', '091546asx56pdjmzumd43h.png,093022lt796e3s6tudz1wy.png,093131qkwgcmkyp7ktx3kc.png', '2021-02-04 09:34:00', '2', '95', 0, NULL, NULL, NULL, NULL, NULL);
