INSERT INTO `zkb_xgyz_log` VALUES ('297615', '7847142', '今天我是知道了，赌狗是上不了岸的', '年前表哥频繁找我借钱\n但是也都是借了还，金额也不大\n都是三百五百的金额\n为什么对他借钱这么敏感呢\n因为他之前赌，在网上搞了几十万的外债\n所以都警惕，我以为他改了\n\n直到今天\n我表哥给我拉群里说让我们几个老表\n给凑点钱给我大姨过年\n问了下情况，大意如下\n\n家里的钱都赌了，前一段时间\n我大姨被车撞了，赔款也都赌了\n现在东窗事发，让我们几个老表给凑点钱\n说是一人拿一千块\n我现在想起来，之前还借我3000至今未还\n我很汗颜，我更是无语\n\n汗颜是，竟然拿着他妈妈赔偿的钱挥霍\n无语是，我之前那么信任他\n以为他房贷还不上，借钱给他\n\n有些错，感觉有些人是纠正不过来的\n所谓救急不救穷\n我也不知道这是不是无底洞\n这时候，谁家不困难呢\n要说困难，我今天能给你说到明天', 'http://www.zuanke8.com/thread-7847142-1-1.html', '2868285528', NULL, '2021-02-04 12:01:00', '0', '25', 0, NULL, NULL, NULL, NULL, NULL);
