INSERT INTO `zkb_xgyz_log` VALUES ('297671', '7847225', '撸美帝羊毛的一个思路 不知道可行不 大家解答下', 'RT 之前我开了富途证券 打算撸港股打新的羊毛  然后入金是一个问题，后来看解决的方案是办个美国银行 华美银行的账户 然后就能把钱转出去了。华美银行貌似每个月存2000美金以上 就能免手续费。那么这个思路下，是不是可以一直存2000美金在里边，然后再用这个卡撸美国的羊毛呢?之前看油管有美帝薅羊毛的攻略 每年撸几千美金都是有的，这样2000块的成本也不算什么。就是不知道入金出金会不会有限制，有了解的吧友吗？觉得我这个思路可行吗？', 'http://www.zuanke8.com/thread-7847225-1-1.html', 'jian6726', NULL, '2021-02-04 12:29:00', '0', '68', 0, NULL, NULL, NULL, NULL, NULL);
