INSERT INTO `zkb_xgyz_log` VALUES ('297813', '7847463', '惠权益这玩的是什么套路？？', '去年11月5号农行铂金权益的，早就显示卖出，前几天又卖了点别的，今天提现显示纠纷中!!!而且卖的还是2户2张\n刚看了券码显示15号就被使用了\n我出个肯德基容易吗，包售后还要包几个月不说，纠纷也要几个月后才告知你，要不是农行的券，谁知道哪个活动或者早删除了，谈何去找！！\n\n而且农行的码什么时候出过问题，，平台找客服找不到不说，纠纷反馈就更是套路卖家，，大家自行避雷吧！！！\n\n卖码子一般都是券码无误被使用纠纷，看看人家的选项，你选哪个？？【图片】', 'http://www.zuanke8.com/thread-7847463-1-1.html', '么系糸', 'http://img.zuanke8.com/forum/202102/04/141808ee99fe0k0s7smk7f.jpg,http://img.zuanke8.com/forum/202102/04/142128vgtiv8pikplg5l40.jpg', '2021-02-04 14:21:00', '0', '32', 0, NULL, NULL, NULL, NULL, NULL);
