INSERT INTO `zkb_xgyz_log` VALUES ('297817', '7847466', '投诉了本地超市过期商品的问题~', '元旦前，花翼支付线下券，在本地超市买的一袋饼干，九个月保质期，没注意临期还剩10天了。\n\n按相关规定是临期商品了，但是没有任何提示，当时有点生气，打了投诉电话，因为不是工作时间，就留了言，描述了商品品牌和规格，但是没说是哪个门店。\n第二天他们回访问详细情况，我说怕因为这个小事情影响你们惩罚门店和员工，我就不说具体哪个门店了，你们自己检查下吧，并且希望以后对临期商品进行醒目提示。\n这事就先过去了。\n\n到前几天，又去那个门店买东西，又看到那个商品了，拿起来一看，生产日期20200417，过期十几天了。拍了个照，没买（哈哈，错过500大毛没想撸），走了。\n又打投诉电话，上来就问：帮我查下一个月前我这个号码投诉的内容，之后你们有做什么嘛。\n然后说我又看到这个商品，并且现在已经过期了，还在售卖。这次又问门店我就给了。\n第二天门店的人回访我，先表示了工作的失误，然后说上次投诉后的第二天总部是发文要求检查了，但是找了一些原因解释。最后打探我口风能不能让我在总部回访时说是看错了，我没同意。\n\n不知道这个事情对门店和员工的影响大不大，吧友评论下我做的对不对~~', 'http://www.zuanke8.com/thread-7847466-1-1.html', 'xinsui1017', NULL, '2021-02-04 14:22:00', '0', '77', 0, NULL, NULL, NULL, NULL, NULL);
