INSERT INTO `zkb_xgyz_log` VALUES ('297885', '7847577', '沃日，浣洗上次bug余额洗的衣服被扣，疑似跑路？', '衣服洗了十几天了，上周客服给我来电话说有一件羽绒服洗丢了，在帮我找找。剩下的可以先帮我寄回来，可是一直没有寄。中间这几天我又催了好几次，一直说帮催促当天可寄出，但是还是没有寄。今天打了一天电话都打不通，然后联系微信客服，报完我的电话后微信客服就装死了。最关键的是再打客服电话，直接提示：您拨打的线路全部繁忙，然后3秒自动挂断    这是被拉黑了？\n\n我寄过去1件羊毛大衣，三件羽绒服。都是平时我舍不得用洗衣机洗的贵重衣服，价值三四千了。还有一双ub鞋子，一双boost鞋子。现在完全联系不上他们了。兄弟们我该怎么办啊！这马上过年了，没有像样的衣服鞋子穿了，我好后悔【图片】', 'http://www.zuanke8.com/thread-7847577-1-1.html', '算什么男人', '151613dgg6gosyueplccs6.jpg', '2021-02-04 15:23:00', '0', '30', 0, NULL, NULL, NULL, NULL, NULL);
