INSERT INTO `zkb_xgyz_log` VALUES ('297911', '7847610', '在知乎看到一个比较贴合实际的问题，关于用什么装骨灰', '如何看待父亲死后儿子用鞋盒装骨灰，殡仪馆人员怼其「不要脸」，却被网友质疑殡仪馆「天价骨灰盒」要价太高？\n一个大学教授死亡火化后，儿子用鞋盒装了老人的骨灰。结果遭到殡仪馆司仪的怒怼：“文化都到哪儿去了！”\n\n评论翻车，网友纷纷说：“你家盒子太贵了，用不起！”“你家盒子但凡便宜一点，人家也不会愿意这么寒酸。”“不要道德绑架，用你家的盒子就是孝子了吗？”\n\n知乎是一面倒的支持教授的儿子，殡葬行业是唯一没人讲价的行业。死者为大，人们一般不会计较殡葬商家要高价。可是视频中所说的哈尔滨某大学教授的儿子显然不是一般人，而且是个能刚的狠人。虽然视频里没说教授儿子为啥用鞋盒子装骨灰，我们可以给出如下场景：殡葬人员介绍说，骨灰盒分高中低档，最低档5000打底。教授儿子一听，心想你这不是讹人吗？我瞧着这骨灰盒还不如泡菜坛子实在呢。教授儿子就和殡葬人员商量，可不可以自己买个瓷坛来装骨灰，遭到严辞拒绝。最后教授儿子一怒之下，从车里取出个鞋盒子装了骨灰。殡葬人员碰到教授儿子这样不按常理出牌的主，骨灰盒没卖出去，心里很憋气。就这么上网传了视频想给教授儿子抹点黑。说实话，广大网友也不糊涂。谁不知道殡葬行业是暴利？你说教授儿子用鞋盒子装骨灰，舍不得给老人花钱，失了文化人的体面。你咋不把殡仪馆的骨灰盒价格晒一晒，让大家看看，教授儿子到底有多抠门呢？\n\n作者：剑上风雷\n链接：<a>https://www.zhihu.com/question/441101618/answer/1710287040</a>\n来源：知乎\n著作权归作者所有。商业转载请联系作者获得授权，非商业转载请注明出处。', 'http://www.zuanke8.com/thread-7847610-1-1.html', '赚我小c', NULL, '2021-02-04 15:41:00', '0', '3', 0, NULL, NULL, NULL, NULL, NULL);
