INSERT INTO `zkb_xgyz_log` VALUES ('298075', '7847835', '大家给个意见，这个宽带升级是否划算', '电信10000号打电话过来推销套餐升级\n\n现在用的套餐：\n\n89一个月，含50m宽带，一台手机每月100分钟，1G流量\n\n推销的新套餐：\n119一个月，含300m宽带，一台手机每月600分钟，40G流量\n\n\n\n困扰我的是：\n\n宽带50m好像也够用了。我有一个京东云，变成300m后京东云能多多少？ 现在一天100多个豆子，升级后能多多少？\n\n手机通话分钟数更加是每月用，我一个月现在打不超过10分钟。\n\n然后流量40G，忘记问客服是否定向流量？我现在是另外移动卡在用流量。这张电信卡也每月用作上网。\n\n\n其实现在89一个月，基本上就是为了50m宽带。所以多30元，变成300m宽带，划算么？', 'http://www.zuanke8.com/thread-7847835-1-1.html', 'realfatboy', NULL, '2021-02-04 17:25:00', '0', '24', 0, NULL, NULL, NULL, NULL, NULL);
