INSERT INTO `zkb_xgyz_log` VALUES ('299182', '7849260', '被垃圾pdd白嫖，和吧友遇到同样的情况了……', '吧友说的情况终于被我碰到了，最后都成了，结果出来个审核失败，秒失败。\n白嫖我花的那么多功夫……\n\n网上搜了下，不少人都遇到了审核失败，言辞激烈的投诉都无果。\n淘宝京东吧友再怎么抱怨，都是符合多劳多得少劳少得不劳不得。\n就算淘宝禁软，用户一用软后果马上是有反馈的，杜绝投机取巧。\npdd则是用户按照庄家pdd制定的规则玩，pdd玩不过了就掀桌翻牌。\n\n既然pdd不尊重底线，可以随便取消，那用户自然也不用尊重pdd，可以胡乱发言。\n网上一搜投诉垃圾pdd的不少，维权花费精力不少，但都无果。\n那诅咒总不用花费成本吧。\n垃圾pdd的资本家和帮凶走狗癌症发作活不过27岁，如果它们活过了27岁，它们的下一辈活不过27岁，以此类推……减少的寿命加起来平摊增加到每一个pdd打工人身上……\n这帖子可能因言辞激烈被删，就看能存活多久吧，懂的都懂，毕竟把白酒当口粮也不是个好习惯……', 'http://www.zuanke8.com/thread-7849260-1-1.html', 'galaxy365', NULL, '2021-02-05 10:20:00', '0', '29', 0, NULL, NULL, NULL, NULL, NULL);
