INSERT INTO `zkb_xgyz_log` VALUES ('299362', '7849502', '都在吐槽小灰灰，有个事10来天了越想越气', '前段时间快手极速版有1分钱肯德基套餐，从来没玩过块手本着赚客不放过一点羊毛的态度先在赚吧找了一圈没有找到新人车头，就在它那个收费平台接了个500灰豆的快手极速版拉新任务，（价值500灰豆5元）按任务要求支付宝扫码下载注册，提交任务后被拒绝了说没有收到我的人头，我就又研究了下发现好像全程只是扫他的码就注册了，注册时没有写邀请码的地方，我又找了找发现有个写邀请码的地方但是填进去提示绑定失败，我就二次反馈了一下问“是不是还要在这里绑定你的邀请码，我怎么提示绑定失败”，原话就是这样反馈的，我本意是想问问能不能抢救一下跟上邀请，毕竟5块钱，结果发任务的再次拒绝还是只说一句没收到我的邀请，并且申请了平台介入，平台让我24小时提交证据证明自己确实做了，我想着一个确实可能我哪步操作错了，二个为了5块钱还提交什么证据瞎折腾再说我也没有证据证明我走他邀请注册的啊，就没管，过了几天登录进去才发现被扣了1.5元，说我没提供证据，我踏马当时就气炸了，钱没赚到还倒被扣1.5，马上找它理论告诉我规则就是这样，谁叫我不认真看的，全程牛逼的很，公众号确实有提醒我平台介入需要提交证据，判断失败的一方要被扣百分之三十，因为我本来也不想折腾了，我就随便看了下只看到了前面让我提交证据，想着可能我确实没做成功而且即使成功了这种新人任务我怎么证明是给他做了？所以没搭理，我主观上已经放弃了这个任务，鬼他妈知道没做成功还要被扣1.5，这什么破烂规则实在把我雷到了，和它争论了半个小时，全程强硬沟通不了最后不了了之，本来也不想吐槽了但看现在吧里提起这个，妈的越想越气，发个帖子发泄下', 'http://www.zuanke8.com/thread-7849502-1-1.html', 'y369538340', NULL, '2021-02-05 11:37:00', '0', '50', 0, NULL, NULL, NULL, NULL, NULL);
