INSERT INTO `zkb_xgyz_log` VALUES ('299429', '7849586', '东哥是兄弟吗？ 服务也就一般啊，哪有什么全额退款又换新的操作啊', '去年过年买的 realme Q 手机，促销999元的那款6+64的，买给老年人用的\n\n\n今年过年回来发现，不插充电器也显示充电，重启后正常\n\n明显是有问题啊，老年人也不懂，每次都是用到自动关机再充电\n\n\n\n充电问题贴 <a>http://www.zuanke8.com/thread-7836634-1-1.html</a>\n\n\n\n\n发帖也没有弄清楚问题，网上搜索说某东服务非常好，有问题找售后即可\n\n还有的说超过保修期几年了，联系某东售后，马上免费维修好，不能修的，马上全额退款 反正是吹的神乎其神的\n\n\n\n  看了一下订单，一年零半个月了，超过保修期，快递员拿走了，有售后打电话说，要换主板，收费799元\n\n手机才999，用了一年了，整个手机也不值799吧？真敢要价啊，那些神服务呢？【图片】', 'http://www.zuanke8.com/thread-7849586-1-1.html', 'hcpxxc', '120620ax4lc4nx3ci66c5c.jpg', '2021-02-05 12:06:00', '0', '37', 0, NULL, NULL, NULL, NULL, NULL);
