INSERT INTO `zkb_xgyz_log` VALUES ('299488', '7849686', '妈妈去世了，问一下身后事，shen/份证和银行卡', '上个月底，妈妈在医院因为多次中风去世了\n\n现在想问问大家，如果shen/份证去派出所注销了，各个银行卡会自动失效不能使用么\n\n已经去派出所办理死亡证明，因为妈妈突然去世没有遗言，要自己去各个银行查存款\n\n临时从派出所把shen/份证借了出来，之后还要到派出所交回去\n\n\n主要是去年用妈妈的银行卡买了5万众邦银行定期，怕以后提现不了要公证就太麻烦了', 'http://www.zuanke8.com/thread-7849686-1-1.html', '青青河边果', NULL, '2021-02-05 12:52:00', '0', '2', 0, NULL, NULL, NULL, NULL, NULL);
