INSERT INTO `zkb_xgyz_log` VALUES ('299501', '7849703', '总结40年来，指尖溜走可以改变命运的机会，包括情感。大家可以抒怀。', '又到了一年一度总结的时候了。感慨。现在没有工作，没有收入。没有老婆，混吃等死。\n时间顺序可能太乱想到哪写哪。\n2019-2020疫情期间没有上车股票，那时账号太多还休眠还限制的，都看到了机会，也分析好了，怂了\n小米10元以下没有上车，原因同上。\n玩客云时没有上明白车，币矿机迅雷股票，已经有2台矿机了当时，还有一些币。\n虚拟币当年有几十万个，如果不是挖了就卖，持有时间长些，可能财务财务自由了，\n2008比特币没有上车，最大的遗憾，\n2015没有做多螺纹钢\n2003毕业以后没有去卖房产\n2003没有开淘宝网店，现在0432都有好多店主了\n\n没有好工作没有资源，自然没有女的跟你，当然没有情感总结。\n昨天把所有股票账号销户完毕。可能会再开一个，从头来。\n现在是大放水万物皆可炒时代了，不管你买入任何资产。固定资产，流动资产，虚拟资产。持有时间只要长一些，我说的长不是几十年上百年。可能也就几天几个月几年？资产的总价值就会翻倍。翻数十倍上百倍。', 'http://www.zuanke8.com/thread-7849703-1-1.html', 'zysnb01', NULL, '2021-02-05 13:03:00', '0', '72', 0, NULL, NULL, NULL, NULL, NULL);
