INSERT INTO `zkb_xgyz_log` VALUES ('299516', '7849726', '大毛！赚吧百万兄弟们跟我冲！！', '此时此刻我已经在高铁站享受快乐\n但我的100万吧友们还在水深火热中\n他们吃不起早点，骑不起共享单车，买高铁票到处找优惠券\n下馆子也会在门口抱着手机徘徊犹疑许久\n你们的心情，我懂得\n你们的节约，我心疼（模仿爽言爽语）\n但我真的懂你们\n你们的省钱的、简单的快乐\n你们的撸毛的、补贴家用的心愿\n你们的赚钱的、实现财富自由的梦想\n真的，没有人比我更懂你们\n因为我就是你们！！！\n\n今天我享受了\n我必然要让我的100万赚吧兄弟姐妹共同福有！！\n希望你们今天都能开心\n希望你们用上贵宾厅的时候都能有一刻帝王的开心！\n\n同程小程序邀请三个微信好友助力\n得高铁贵宾厅+腾讯月卡+肯德基+星巴克，还有小食美女陪伴！\n吧友人均10个微信，无限好友，有能力多撸\n开开心心地上吧！做一个快乐的撸毛人！【图片】', 'http://www.zuanke8.com/thread-7849726-1-1.html', '成都旧事', '131527nfrf103yr16u7xgz.jpg', '2021-02-05 13:18:00', '0', '26', 0, NULL, NULL, NULL, NULL, NULL);
